window.bookSummaryJSON = "<p><b>Audie Award Winner, Thriller/Suspense, 2014</b></p> <p>From David Baldacci - number-one best-selling author and one of the world's most popular, widely read storytellers - comes the most thrilling novel of the year. </p> <p>Will Robie is a master of killing. </p> <p>A highly skilled assassin, Robie is the man the U.S. government calls on to eliminate the worst of the worst - enemies of the state, monsters committed to harming untold numbers of innocent victims. </p> <p>No one else can match Robie's talents as a hitman...no one, except Jessica Reel. A fellow assassin, equally professional and dangerous, Reel is every bit as lethal as Robie. And now, she's gone rogue, turning her gun sights on other members of their agency. </p> <p>To stop one of their own, the government looks again to Will Robie. His mission: bring in Reel, dead or alive. Only a killer can catch another killer, they tell him. </p> <p></p> <p>But as Robie pursues Reel, he quickly finds that there is more to her betrayal than meets the eye. Her attacks on the agency conceal a larger threat, a threat that could send shockwaves through the U.S. government and around the world.</p>"; 
